about book :-

Hendrickx, a trainer and consultant in autistic spectrum (AS) conditions and partner of a man with AS, explores questions related to sexual behavior and sexual relationships in people with AS. The voices of real-life men and women with AS, and their partners, offer insight on AS attitudes towards sexual identity, developing relationships, and exploring options and choices for sexual pleasure. The book will be useful for couples in which one or both partners has AS, and for counselors and health and social care professionals.
